import React from "react";
import "../styles/Tools.css";

export default function Tools(ac) {
  const test = () => {
    ac.dc.clientList.map((item) => {
      console.log("item", item);
    });
  };
  //   console.log("App -> Tools", ac.dc.networkList);
  return (
    <div id="page-inner">
      <div class="row">
        <div class="col-xs-12">
          <div class="panel panel-default">
            <div class="panel-heading"></div>
            <div class="panel-body">
              <button onClick={test}>BUTTON</button>
              <div class="sub-title">Select Tools</div>
              <div>
                <select class="selectbox">
                  <optgroup label="Tshoot Tools">
                    <option value="AK">IP adressess</option>
                    <option value="HI">Top 10</option>
                  </optgroup>
                </select>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}
